import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getActuByID } from "../../actions/actus";
import { isEmpty } from "../utils/index";
import { NavLink } from "react-router-dom";

import { createActu, updateActu, deleteActu } from "../../actions/actus";

const Actus = () => {
  const dispatch = useDispatch();
  const actus = useSelector((state) => state.actus);

  !isEmpty(actus) &&
    actus.sort((a, b) => {
      return b.createdAt.localeCompare(a.createdAt);
    });

  const user = useSelector((state) => state.user.user);

  // Afficher / Cacher le formulaire
  const [toggleForm, setToggleForm] = useState(false);

  // Fichiers données
  const [files, setFiles] = useState([]);
  const [fileSet, setFileSet] = useState([]);

  const [isOk, setIsOk] = useState(false);

  const [isSetForm, setIsSetForm] = useState(false);

  // Mode édition
  const [isEdit, setIsEdit] = useState(false);
  const [actuEdit, setActuEdit] = useState(false);

  return <div>Actus</div>;
};

export default Actus;
